import React, { useState } from 'react';
import styles from './ChatApp.module.css';
import lock from '../assets/Vector.png';
import bgImage from '../assets/bgimage.png';
import createGroupIcon from '../assets/+.png';
import Popup from './Popup';

const ChatApp = () => {
  const [notesGroups, setnotesGroups] = useState([]);
  const [selectednotesGroup, setSelectednotesGroup] = useState(null);
  const [newTextText, setNewTextText] = useState('');
  const [noteGroups, setNoteGroups] = useState([]); // State to manage note groups
  const [isPopupOpen, setIsPopupOpen] = useState(false);

  const handleCreateGroup = (groupName, selectedColor) => {
    // Implement your logic to create a group here
    // You can use this function to manage your groups in the App component
    console.log(`Creating group: ${groupName} with color: ${selectedColor}`);
    const newGroup = {
      name: groupName,
      color: selectedColor,
      notes: [],
    };
    setNoteGroups([...noteGroups, newGroup]);
    setIsPopupOpen(false); // Close the popup after creating the group
  };

  const openPopup = () => {
    setIsPopupOpen(true);
  };

  const closePopup = () => {
    setIsPopupOpen(false);
  };

  const createText = () => {
    if (selectednotesGroup) {
      const newText = {
        content: newTextText,
        sender: 'User',
        timestamp: new Date().toLocaleString(),
      };

      const updatednotesGroups = notesGroups.map((notesGroup) => {
        if (notesGroup.id === selectednotesGroup.id) {
          return {
            ...notesGroup,
            notes: [...notesGroup.notes, newText],
          };
        }
        return notesGroup;
      });

      setnotesGroups(updatednotesGroups);
      setNewTextText('');
    }
  };

  return (
    <div className={styles.chatApp}>
      <div className={styles.notesGroups}>
        <div className="group-container">
          <h1>Pocket Notes</h1>
          <button className={styles.button} onClick={openPopup}>
            <img src={createGroupIcon} alt="Create Group" />
            Create Notes group
          </button>
        </div>
        {noteGroups.map((group) => (
          <div
            key={group.name}
            className={`${styles.notesGroup} ${
              selectednotesGroup && selectednotesGroup.name === group.name
                ? styles.selectednotesGroup
                : ''
            }`}
            onClick={() => setSelectednotesGroup(group)}
            style={{ backgroundColor: group.color }}
          >
            {group.name}
          </div>
        ))}
      </div>
      <div className={styles.Texts}>
        <div className={isPopupOpen ? styles.hiddenContent : ''}>
          <img src={bgImage} alt={bgImage} className={styles.bgImage} />
          <p className={styles.pocketnotes}>Pocket Notes</p>
          <p className={styles.description}>
            Send and receive Texts without keeping your phone online.
            <br />
            Use Pocket Notes on up to 4 linked devices and 1 mobile phone
          </p>
          <div className={styles.FooterContainer}>
            <img src={lock} alt="lock" />
            <p>end-to-end encrypted</p>
          </div>
          {selectednotesGroup && (
            <div className={styles.TextContainer}>
              {selectednotesGroup.notes.map((note, index) => (
                <div
                  key={index}
                  className={`${
                    note.sender === 'User' ? styles.sentText : styles.receivedText
                  }`}
                >
                  <div className={styles.TextContent}>{note.content}</div>
                  <div className={styles.timestamp}>{note.timestamp}</div>
                </div>
              ))}
            </div>
          )}
          {selectednotesGroup && (
            <div className={styles.TextInput}>
              <input
                type="text"
                placeholder="Type your Text here..."
                value={newTextText}
                onChange={(e) => setNewTextText(e.target.value)}
              />
              <button onClick={createText}>Send</button>
            </div>
          )}
        </div>
        {isPopupOpen && (
          <Popup isPopupOpen={isPopupOpen} closePopup={closePopup} createGroup={handleCreateGroup} />
        )}
      </div>
    </div>
  );
};

export default ChatApp;
